INSERT INTO `t_news` VALUES (10, '测试标题', '<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" width=\"537\" height=\"537\" /></p>\n<p>555</p>\n<pre style=\"background-color: #2b2b2b; color: #a9b7c6; font-family: \'Droid Sans Mono Slashed\'; font-size: 12.0pt;\"><span style=\"color: #bbb529;\">@DeleteMapping</span>(<span style=\"color: #6a8759;\">\"/{id}\"</span>)<br /><span style=\"color: #cc7832;\">public </span>Result&lt;?&gt; <span style=\"color: #ffc66d;\">delete</span>(<span style=\"color: #bbb529;\">@PathVariable </span>Long id) {<br />    <span style=\"color: #9876aa;\">newsService</span>.removeById(id)<span style=\"color: #cc7832;\">;<br /></span><span style=\"color: #cc7832;\">    return </span>Result.<span style=\"font-style: italic;\">success</span>()<span style=\"color: #cc7832;\">;<br /></span>}</pre>\n<p>&nbsp;</p>\n<p style=\"text-align: center;\">&nbsp;</p>\n<table style=\"border-collapse: collapse; width: 43.9728%; height: 44px;\" border=\"1\">\n<tbody>\n<tr style=\"height: 22px;\">\n<td style=\"width: 48.8031%; height: 22px;\">11</td>\n<td style=\"width: 48.8031%; height: 22px;\">22</td>\n</tr>\n<tr style=\"height: 22px;\">\n<td style=\"width: 48.8031%; height: 22px;\">33</td>\n<td style=\"width: 48.8031%; height: 22px;\">44</td>\n</tr>\n</tbody>\n</table>', '2021-06-30 15:42:50', NULL);
INSERT INTO `t_news` VALUES (11, '代码测试', '<pre style=\"font-size: 12pt; background-color: #2b2b2b; color: #a9b7c6; font-family: \'Droid Sans Mono Slashed\';\"><span style=\"color: #bbb529;\">@PutMapping<br /></span><span style=\"color: #cc7832;\">public </span>Result&lt;?&gt; <span style=\"color: #ffc66d;\">update</span>(<span style=\"color: #bbb529;\">@RequestBody </span>News blog) {<br />    blog.setTime(<span style=\"color: #cc7832;\">new </span>SimpleDateFormat(<span style=\"color: #6a8759;\">\"yyyy-MM-dd HH:mm:ss\"</span>).format(<span style=\"color: #cc7832;\">new </span>Date()))<span style=\"color: #cc7832;\">;<br /></span><span style=\"color: #cc7832;\">    return </span>Result.<span style=\"font-style: italic;\">success</span>(<span style=\"color: #9876aa;\">newsService</span>.updateById(blog))<span style=\"color: #cc7832;\">;<br /></span>}</pre>\n<div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: #333333; margin-bottom: 5px; text-indent: 28px; line-height: 24px; zoom: 1; font-family: arial, tahoma, \'Microsoft Yahei\', 宋体, sans-serif; background-color: #ffffff;\" data-pid=\"1\">&nbsp;</div>\n<div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: #333333; margin-bottom: 5px; text-indent: 28px; line-height: 1.5; zoom: 1; font-family: arial, tahoma, \'Microsoft Yahei\', 宋体, sans-serif; background-color: #ffffff;\" data-pid=\"1\"><span style=\"font-size: 14pt;\">同济大学（Tongji University）简称&ldquo;同济&rdquo;，是<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E4%B8%AD%E5%8D%8E%E4%BA%BA%E6%B0%91%E5%85%B1%E5%92%8C%E5%9B%BD%E6%95%99%E8%82%B2%E9%83%A8/3507526\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"3507526\">中华人民共和国教育部</a>直属，教育部与<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%9B%BD%E5%AE%B6%E6%B5%B7%E6%B4%8B%E5%B1%80/9930877\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"9930877\">国家海洋局</a>、上海市共建的<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%85%A8%E5%9B%BD%E9%87%8D%E7%82%B9%E5%A4%A7%E5%AD%A6/2154589\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"2154589\">全国重点大学</a>；中央直管副部级建制高校，国家&ldquo;<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E4%B8%96%E7%95%8C%E4%B8%80%E6%B5%81%E5%A4%A7%E5%AD%A6%E5%BB%BA%E8%AE%BE%E9%AB%98%E6%A0%A1/22189945\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"22189945\">世界一流大学建设高校</a>&rdquo;，国家&ldquo;<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/211%E5%B7%A5%E7%A8%8B/203547\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"203547\">211工程</a>&rdquo;和&ldquo;<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/985%E5%B7%A5%E7%A8%8B/1077915\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"1077915\">985工程</a>&rdquo;建设高校；入选国家&ldquo;珠峰计划&rdquo;、&ldquo;<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%BC%BA%E5%9F%BA%E8%AE%A1%E5%88%92/24266392\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"24266392\">强基计划</a>&rdquo;、&ldquo;<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/2011%E8%AE%A1%E5%88%92/2913309\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"2913309\">2011计划</a>&rdquo;、&ldquo;<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/111%E8%AE%A1%E5%88%92/10958807\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"10958807\">111计划</a>&rdquo;、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%8D%93%E8%B6%8A%E5%B7%A5%E7%A8%8B%E5%B8%88%E6%95%99%E8%82%B2%E5%9F%B9%E5%85%BB%E8%AE%A1%E5%88%92/4942299\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"4942299\">卓越工程师教育培养计划</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%8D%93%E8%B6%8A%E6%B3%95%E5%BE%8B%E4%BA%BA%E6%89%8D%E6%95%99%E8%82%B2%E5%9F%B9%E5%85%BB%E8%AE%A1%E5%88%92/9781317\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"9781317\">卓越法律人才教育培养计划</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%8D%93%E8%B6%8A%E5%8C%BB%E7%94%9F%E6%95%99%E8%82%B2%E5%9F%B9%E5%85%BB%E8%AE%A1%E5%88%92/3805307\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"3805307\">卓越医生教育培养计划</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%9B%BD%E5%AE%B6%E5%A4%A7%E5%AD%A6%E7%94%9F%E5%88%9B%E6%96%B0%E6%80%A7%E5%AE%9E%E9%AA%8C%E8%AE%A1%E5%88%92/5326077\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"5326077\">国家大学生创新性实验计划</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%9B%BD%E5%AE%B6%E5%BB%BA%E8%AE%BE%E9%AB%98%E6%B0%B4%E5%B9%B3%E5%A4%A7%E5%AD%A6%E5%85%AC%E6%B4%BE%E7%A0%94%E7%A9%B6%E7%94%9F%E9%A1%B9%E7%9B%AE/819876\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"819876\">国家建设高水平大学公派研究生项目</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E4%B8%AD%E5%9B%BD%E6%94%BF%E5%BA%9C%E5%A5%96%E5%AD%A6%E9%87%91%E6%9D%A5%E5%8D%8E%E7%95%99%E5%AD%A6%E7%94%9F%E6%8E%A5%E6%94%B6%E9%99%A2%E6%A0%A1/15447730\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"15447730\">中国政府奖学金来华留学生接收院校</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%9B%BD%E5%AE%B6%E7%BA%A7%E5%A4%A7%E5%AD%A6%E7%94%9F%E5%88%9B%E6%96%B0%E5%88%9B%E4%B8%9A%E8%AE%AD%E7%BB%83%E8%AE%A1%E5%88%92/8962344\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"8962344\">国家级大学生创新创业训练计划</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%9B%BD%E5%AE%B6%E5%88%9B%E6%96%B0%E4%BA%BA%E6%89%8D%E5%9F%B9%E5%85%BB%E7%A4%BA%E8%8C%83%E5%9F%BA%E5%9C%B0/2718655\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"2718655\">国家创新人才培养示范基地</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E6%96%B0%E5%B7%A5%E7%A7%91%E7%A0%94%E7%A9%B6%E4%B8%8E%E5%AE%9E%E8%B7%B5%E9%A1%B9%E7%9B%AE/22833448\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"22833448\">新工科研究与实践项目</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%85%A8%E5%9B%BD%E6%B7%B1%E5%8C%96%E5%88%9B%E6%96%B0%E5%88%9B%E4%B8%9A%E6%95%99%E8%82%B2%E6%94%B9%E9%9D%A9%E7%A4%BA%E8%8C%83%E9%AB%98%E6%A0%A1/22051296\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"22051296\">全国深化创新创业教育改革示范高校</a>、中美&ldquo;10+10&rdquo;计划，首批<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%AD%A6%E4%BD%8D%E6%8E%88%E6%9D%83%E8%87%AA%E4%B8%BB%E5%AE%A1%E6%A0%B8%E5%8D%95%E4%BD%8D/23552013\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"23552013\">学位授权自主审核单位</a>，<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E8%81%94%E5%90%88%E5%9B%BD%E7%8E%AF%E5%A2%83%E8%A7%84%E5%88%92%E7%BD%B2/1516707\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"1516707\">联合国环境规划署</a>全球环境与可持续发展大学合作联盟主席单位，<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%9B%BD%E9%99%85%E8%AE%BE%E8%AE%A1%E8%89%BA%E6%9C%AF%E9%99%A2%E6%A0%A1%E8%81%94%E7%9B%9F/750608\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"750608\">国际设计艺术院校联盟</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/21%E4%B8%96%E7%BA%AA%E5%AD%A6%E6%9C%AF%E8%81%94%E7%9B%9F/7773858\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"7773858\">21世纪学术联盟</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%8D%93%E8%B6%8A%E5%A4%A7%E5%AD%A6%E8%81%94%E7%9B%9F/8296583\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"8296583\">卓越大学联盟</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E4%B8%AD%E4%BF%84%E5%B7%A5%E7%A7%91%E5%A4%A7%E5%AD%A6%E8%81%94%E7%9B%9F/7527224\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"7527224\">中俄工科大学联盟</a>、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E4%B8%AD%E6%AC%A7%E5%B7%A5%E7%A8%8B%E6%95%99%E8%82%B2%E5%B9%B3%E5%8F%B0/790746\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"790746\">中欧工程教育平台</a>、中国绿色大学联盟、国际绿色校园联盟、<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%90%8C%E6%B5%8E/79046\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"79046\">同济</a>&mdash;<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E4%BC%AF%E5%85%8B%E5%88%A9/25375\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"25375\">伯克利</a>工程联盟成员。</span></div>\n<div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: #333333; margin-bottom: 5px; text-indent: 28px; line-height: 1.5; zoom: 1; font-family: arial, tahoma, \'Microsoft Yahei\', 宋体, sans-serif; background-color: #ffffff;\" data-pid=\"1\">&nbsp;</div>\n<div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: #333333; margin-bottom: 5px; text-indent: 28px; line-height: 1.5; zoom: 1; font-family: arial, tahoma, \'Microsoft Yahei\', 宋体, sans-serif; background-color: #ffffff;\" data-pid=\"1\"><span style=\"font-size: 14pt;\"><img style=\"color: #000000; font-family: -apple-system, BlinkMacSystemFont, \'Segoe UI\', Roboto, Oxygen, Ubuntu, Cantarell, \'Open Sans\', \'Helvetica Neue\', sans-serif; font-size: medium; text-indent: 0px; display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" width=\"370\" height=\"370\" /></span></div>\n<div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: #333333; margin-bottom: 5px; text-indent: 28px; line-height: 1.5; zoom: 1; font-family: arial, tahoma, \'Microsoft Yahei\', 宋体, sans-serif; background-color: #ffffff;\" data-pid=\"1\">&nbsp;</div>\n<div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: #333333; margin-bottom: 5px; text-indent: 28px; line-height: 1.5; zoom: 1; font-family: arial, tahoma, \'Microsoft Yahei\', 宋体, sans-serif; background-color: #ffffff;\" data-pid=\"2\"><span style=\"font-size: 14pt;\">同济大学前身是1907年德国医生<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%9F%83%E9%87%8C%E5%B8%8C%C2%B7%E5%AE%9D%E9%9A%86/1886065\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"1886065\">埃里希&middot;宝隆</a>在上海创办的<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%BE%B7%E6%96%87%E5%8C%BB%E5%AD%A6%E5%A0%82/5673324\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"5673324\">德文医学堂</a>；1908年改名<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%90%8C%E6%B5%8E%E5%BE%B7%E6%96%87%E5%8C%BB%E5%AD%A6%E5%A0%82/4046272\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"4046272\">同济德文医学堂</a>；1912年与创办不久的同济德文工学堂合称同济德文医工学堂；1923年正式定名同济大学；1927年成为<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%9B%BD%E7%AB%8B%E5%90%8C%E6%B5%8E%E5%A4%A7%E5%AD%A6/787408\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"787408\">国立同济大学</a>，是中国最早的七所<a style=\"color: #136ec2; text-decoration-line: none;\" href=\"https://baike.baidu.com/item/%E5%9B%BD%E7%AB%8B%E5%A4%A7%E5%AD%A6/8379799\" target=\"_blank\" rel=\"noopener\" data-lemmaid=\"8379799\">国立大学</a>之一。</span></div>\n<div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: #333333; margin-bottom: 5px; text-indent: 28px; line-height: 1.5; zoom: 1; font-family: arial, tahoma, \'Microsoft Yahei\', 宋体, sans-serif; background-color: #ffffff;\" data-pid=\"2\">&nbsp;</div>\n<div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: #333333; margin-bottom: 5px; text-indent: 28px; line-height: 1.5; zoom: 1; font-family: arial, tahoma, \'Microsoft Yahei\', 宋体, sans-serif; background-color: #ffffff;\" data-pid=\"2\"><code><span style=\"font-size: 14pt;\">hello word;</span></code></div>\n<div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: #333333; margin-bottom: 5px; text-indent: 28px; line-height: 1.5; zoom: 1; font-family: arial, tahoma, \'Microsoft Yahei\', 宋体, sans-serif; background-color: #ffffff;\" data-pid=\"2\">&nbsp;</div>\n<div class=\"para\" style=\"font-size: 14px; overflow-wrap: break-word; color: #333333; margin-bottom: 5px; text-indent: 28px; line-height: 1.5; zoom: 1; font-family: arial, tahoma, \'Microsoft Yahei\', 宋体, sans-serif; background-color: #ffffff;\" data-pid=\"3\"><span style=\"font-size: 14pt;\">截至2021年5月，学校设有29个专业学院，9家附属医院。4个校区占地3960亩，总建筑面积183余万平方米。拥有全日制本科生18510人，硕士研究生11038人，博士研究生6514人。另有国际学生2225人</span></div>\n<pre style=\"font-size: 12pt; background-color: #2b2b2b; color: #a9b7c6; font-family: \'Droid Sans Mono Slashed\';\"><span style=\"color: #bbb529;\">@PutMapping<br /></span><span style=\"color: #cc7832;\">public </span>Result&lt;?&gt; <span style=\"color: #ffc66d;\">update</span>(<span style=\"color: #bbb529;\">@RequestBody </span>News blog) {<br />    blog.setTime(<span style=\"color: #cc7832;\">new </span>SimpleDateFormat(<span style=\"color: #6a8759;\">\"yyyy-MM-dd HH:mm:ss\"</span>).format(<span style=\"color: #cc7832;\">new </span>Date()))<span style=\"color: #cc7832;\">;<br /></span><span style=\"color: #cc7832;\">    return </span>Result.<span style=\"font-style: italic;\">success</span>(<span style=\"color: #9876aa;\">newsService</span>.updateById(blog))<span style=\"color: #cc7832;\">;<br /></span>}</pre>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '2021-06-30 22:08:11', 'admin');

-- ----------------------------
-- Table structure for t_notice
-- ----------------------------
DROP TABLE IF EXISTS `t_notice`;
CREATE TABLE `t_notice`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '标题',
  `content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL COMMENT '内容',
  `time` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL DEFAULT NULL COMMENT '发布时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 7 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_unicode_ci ROW_FORMAT = Dynamic;

